function info_show() {
if($("#popup_nitro").classList.contains("none") || $("#popup_piston").classList.contains("none") || $("#popup_circuit").classList.contains("none") || $("#popup_sensor").classList.contains("none") || $("#popup_tention").classList.contains("none") || $("#popup_displacement").classList.contains("none") || $("#popup_mating").classList.contains("none") || $("#popup_ball").classList.contains("none") || $("#popup_bellows").classList.contains("none") || $("#popup_adj_rest").classList.contains("none") || $("#popup_int_check").classList.contains("none") || $("#popup_catch").classList.contains("none") || $("#popup_out_coupler").classList.contains("none") || $("#popup_in_coupler").classList.contains("none") || $("#popup_demonstrate").classList.contains("none")) {
  $("#popup_nitro").classList.remove("none");
  $("#popup_piston").classList.remove("none");
  $("#popup_circuit").classList.remove("none");
  $("#popup_sensor").classList.remove("none");
  $("#popup_tention").classList.remove("none");
  $("#popup_displacement").classList.remove("none");
  $("#popup_mating").classList.remove("none");
  $("#popup_ball").classList.remove("none");
  $("#popup_bellows").classList.remove("none");
  $("#popup_adj_rest").classList.remove("none");
  $("#popup_int_check").classList.remove("none");
  $("#popup_catch").classList.remove("none");
  $("#popup_out_coupler").classList.remove("none");
  $("#popup_in_coupler").classList.remove("none");
  $("#popup_demonstrate").classList.remove("none");
  setTimeout(function(){
    $("#popup_nitro").classList.remove("invis");
    $("#popup_piston").classList.remove("invis");
    $("#popup_circuit").classList.remove("invis");
    $("#popup_sensor").classList.remove("invis");
    $("#popup_tention").classList.remove("invis");
    $("#popup_displacement").classList.remove("invis");
    $("#popup_mating").classList.remove("invis");
    $("#popup_ball").classList.remove("invis");
    $("#popup_bellows").classList.remove("invis");
    $("#popup_adj_rest").classList.remove("invis");
    $("#popup_int_check").classList.remove("invis");
    $("#popup_catch").classList.remove("invis");
    $("#popup_out_coupler").classList.remove("invis");
    $("#popup_in_coupler").classList.remove("invis");
    $("#popup_demonstrate").classList.remove("invis");
  }, 40);
} else {
  $("#popup_nitro").classList.toggle("invis");
  $("#popup_piston").classList.toggle("invis");
  $("#popup_circuit").classList.toggle("invis");
  $("#popup_sensor").classList.toggle("invis");
  $("#popup_tention").classList.toggle("invis");
  $("#popup_displacement").classList.toggle("invis");
  $("#popup_mating").classList.toggle("invis");
  $("#popup_ball").classList.toggle("invis");
  $("#popup_bellows").classList.toggle("invis");
  $("#popup_adj_rest").classList.toggle("invis");
  $("#popup_int_check").classList.toggle("invis");
  $("#popup_catch").classList.toggle("invis");
  $("#popup_out_coupler").classList.toggle("invis");
  $("#popup_in_coupler").classList.toggle("invis");
  $("#popup_demonstrate").classList.toggle("invis");
  setTimeout(function(){
    $("#popup_nitro").classList.toggle("none");
    $("#popup_piston").classList.toggle("none");
    $("#popup_circuit").classList.toggle("none");
    $("#popup_sensor").classList.toggle("none");
    $("#popup_tention").classList.toggle("none");
    $("#popup_displacement").classList.toggle("none");
    $("#popup_mating").classList.toggle("none");
    $("#popup_ball").classList.toggle("none");
    $("#popup_bellows").classList.toggle("none");
    $("#popup_adj_rest").classList.toggle("none");
    $("#popup_int_check").classList.toggle("none");
    $("#popup_catch").classList.toggle("none");
    $("#popup_out_coupler").classList.toggle("none");
    $("#popup_in_coupler").classList.toggle("none");
