window.onmouseup = function() {clearInterval(setint)};

function oscillate_up() {
  if(osc_iter > 0) {
    osc_iter--;
    if(osc_iter >= 10) {
      osc_pos++;
        //$("#r_piston").setAttribute("transform", "translate(0 " + (w_angle / 5 * -0.234 - osc_pos) + ")");
        $("#big_piston").setAttribute("transform", "translate(0 " + osc_pos * -1 + ")");
        //$("#r_spring").setAttribute("transform", "translate(1258.5 683.9) scale(1 " + (1.1 + w_angle / 5 * 0.0042553 + osc_pos/100) + ") translate(-1258.5 -683.9)");
        $("#bottom_spring").setAttribute("transform", "translate(961.8 690.5) scale(1 " + (1.3 - w_angle / 5 * 0.006383 - osc_pos/20) + ") translate(-961.8 -690.5)");
    } else {
      osc_pos--;
      //$("#r_piston").setAttribute("transform", "translate(0 " + (w_angle / 5 * -0.234 - osc_pos) + ")");
      $("#big_piston").setAttribute("transform", "translate(0 " + osc_pos * -1 + ")");
      //$("#r_spring").setAttribute("transform", "translate(1258.5 683.9) scale(1 " + (1.1 + w_angle / 5 * 0.0042553 + osc_pos/100) + ") translate(-1258.5 -683.9)");
      $("#bottom_spring").setAttribute("transform", "translate(961.8 690.5) scale(1 " + (1.3 - w_angle / 5 * 0.006383 - osc_pos/20) + ") translate(-961.8 -690.5)");
    }
  } else {
    clearInterval(setint2);
    osc_iter = 20;
  }
}

function oscillate_down() {
  if(osc_iter > 0) {
    osc_iter--;
    if(osc_iter >= 10) {
      osc_pos++;
        //$("#r_piston").setAttribute("transform", "translate(0 " + (w_angle / 5 * -0.234 + osc_pos) + ")");
        $("#big_piston").setAttribute("transform", "translate(0 " + osc_pos + ")");
        //$("#r_spring").setAttribute("transform", "translate(1258.5 683.9) scale(1 " + (1.1 + w_angle / 5 * 0.0042553 - osc_pos/100) + ") translate(-1258.5 -683.9)");
        $("#bottom_spring").setAttribute("transform", "translate(961.8 690.5) scale(1 " + (1.3 - w_angle / 5 * 0.006383 + osc_pos/20) + ") translate(-961.8 -690.5)");
    } else {
      osc_pos--;
      //$("#r_piston").setAttribute("transform", "translate(0 " + (w_angle / 5 * -0.234 + osc_pos) + ")");
      $("#big_piston").setAttribute("transform", "translate(0 " + osc_pos + ")");
      //$("#r_spring").setAttribute("transform", "translate(1258.5 683.9) scale(1 " + (1.1 + w_angle / 5 * 0.0042553 - osc_pos/100) + ") translate(-1258.5 -683.9)");
      $("#bottom_spring").setAttribute("transform", "translate(961.8 690.5) scale(1 " + (1.3 - w_angle / 5 * 0.006383 + osc_pos/20) + ") translate(-961.8 -690.5)");
    }
  } else {
    clearInterval(setint2);
    osc_iter = 20;
  }
}

function start_oscillate_up() {
  clearInterval(setint2);
  setint2 = setInterval(function(){oscillate_up()}, 10);
}

function start_oscillate_down() {
  clearInterval(setint2);
  setint2 = setInterval(function(){oscillate_down()}, 10);
}

