function animate() {
  if(arrows_shift < 40) {
    arrows_shift += w_angle / 100;
    $("#q_01").setAttribute("transform", "translate(0 " + arrows_shift * -0.75 + ")");
    $("#q_02").setAttribute("transform", "translate(" + arrows_shift * -0.5 + " 0)");
    $("#q_03").setAttribute("transform", "translate(" + arrows_shift * 0.5 + " 0)");
    $("#q_04").setAttribute("transform", "translate(0 " + arrows_shift * -0.5 + ")");
    $("#q_05").setAttribute("transform", "translate(" + arrows_shift * 0.25 + " 0)");
    $("#q_06").setAttribute("transform", "translate(" + arrows_shift * -0.25 + " 0)");
    $("#q_07").setAttribute("transform", "translate(0 " + arrows_shift * -0.75 + ")");
    $("#q_08").setAttribute("transform", "translate(" + arrows_shift * -0.75 + " 0)");
    $("#q_09").setAttribute("transform", "translate(0 " + arrows_shift * -0.75 + ")");
    $("#q_10").setAttribute("transform", "translate(" + arrows_shift * -0.75 + " 0)");
    $("#q_11").setAttribute("transform", "translate(0 " + arrows_shift * 0.75 + ")");
    $("#q_12").setAttribute("transform", "translate(0 " + arrows_shift + ")");
    $("#q_13").setAttribute("transform", "translate(" + arrows_shift * -1 + " 0)");
    $("#q_14").setAttribute("transform", "translate(" + arrows_shift * -0.15 + " " + arrows_shift * -0.9875 + ")");
    $("#q_15").setAttribute("transform", "translate(" + arrows_shift * -1 + " 0)");
    $("#q_16").setAttribute("transform", "translate(" + arrows_shift * -1 + " 0)");
    $("#q_17").setAttribute("transform", "translate(" + arrows_shift * -1 + " 0)");
    $("#q_18").setAttribute("transform", "translate(" + arrows_shift * 0.22 + " " + arrows_shift * 0.975 + ")");
    $("#q_19").setAttribute("transform", "translate(" + arrows_shift + " 0)");
    $("#q_20").setAttribute("transform", "translate(0 " + arrows_shift * -1 + ")");
    $("#q_21").setAttribute("transform", "translate(" + arrows_shift * -1 + " 0)");
    $("#q_22").setAttribute("transform", "translate(" + arrows_shift * -0.75 + " 0)");
    $("#q_23").setAttribute("transform", "translate(0 " + arrows_shift * 0.75 + ")");
  } else {
    arrows_shift = 1;
  }
    animation_id = requestAnimationFrame(animate);
}
